'use strict';
//@@DocBrief("The terminal class")
class Terminal {
    type;
    name;
    subId;
    status;
    inactiveText;
    urls;
    streams;
    id;
    getId() {
        return this.id;
    }
    getType() {
        return this.type;
    }
    getName() {
        return this.name;
    }
    getSubId() {
        return this.subId;
    }
    getStatus() {
        return this.status;
    }
    getInactiveText() {
        return this.inactiveText;
    }
    getUrls() {
        return this.urls;
    }
    getStreams() {
        return this.streams;
    }
}
module.exports = Terminal
